import React from "react";
import { MainWrapper, TopPanel, LogoLink } from "./style";

const Header = () => {
  return (
    <MainWrapper>
      <TopPanel>
        <LogoLink>airbnb</LogoLink>
      </TopPanel>
    </MainWrapper>
  );
};

export default Header;
